import React, { Component } from 'react';
import Chip from '@material-ui/core/Chip';

const Style = {
    sass: {
        color: '#ff0080',
        borderWidth: 2,
        borderColor: 'orange'
    }
};

export default class ChipsSASS extends Component {
    render() {
        return (
            <Chip label="SASS" style={Style.sass}/>
        );
    }
}
